Request: Field Type Description command string Command - for this operation it will be the string "simulate-gsl" definition model-def Definition of the model start number Start time of the simulation end number End time of the simulation step number Simulation time step size parameters dict Parameter values/initial conditions for the simulation Example: { "command": "simulate-gsl", "definition": { "type": "easel", "source": { "model": "sir.easel" } }, "start": 0, "end": 120.0, "step": 30.0, "parameters": { "beta": 0.9 }
} Response: Field Type Description times list of number series of times used in simulation values result series object values of state varaibles The object in values is such that each key is the name of a model variable V and each value is a list l such that V has the value l[x] at time times[x]. Example: { "status": "success", "result": { "values": { "I": [ 3, 396.20766691080604, 119.33588838987737, 35.943279530151585, 10.825907756942332 ], "S": [ 997, 0.0012550867795002216, 2.4726152151230926e-06, 3.7868257221162325e-07, 2.151977671793774e-07 ], "R": [ 0, 603.7910780024147, 880.6641091375077, 964.0567200911661, 989.1740920278602 ] }, "times": [ 0, 30, 60, 90, 120 ] }
}

