This call gets a high level schematic description of a model as a graph. Not all models support this visualization. Request: Field Type Description command string Command - for this operation it will be the string "get-model-schematic" definition model-def Definition of the model Example: { "command": "get-model-schematic", "definition": { "type": "easel", "source": { "model": "sir.easel" } }
} Response: Field Type Description nodes list of node A node has a name and a type edges list of edge An edge is a "tuple" mapping one node to another { "status": "success", "result": { "nodes": [ { "name": "Infect", "type": "event" }, { "name": "S", "type": "state" }, { "name": "I", "type": "state" }, { "name": "Remove", "type": "event" }, { "name": "R", "type": "state" } ], "edges": [ [ { "name": "Infect", "type": "event" }, { "name": "I", "type": "state" } ], [ { "name": "S", "type": "state" }, { "name": "Infect", "type": "event" } ], [ { "name": "I", "type": "state" }, { "name": "Remove", "type": "event" } ], [ { "name": "Remove", "type": "event" }, { "name": "R", "type": "state" } ] ] }
}

