Request: Field Type Description command string Command - for this operation it will be the string "describe-model-interface" definition model-def Definition of the model { "command": "describe-model-interface", "definition": { "type": "easel", "source": { "model": "sir.easel" } }
} Response Field Type Description measures list of state variables Something the can be measured parameters list of parameter Something that can be tweaked Both measures and parameters are lists of objects, where each object has uid, value_type and metadata fields. In addition, parameters may have a default field. The metadata is an object with variable fields, but some of interest are description, name, and group. In particular, group may be used as a hint to group related parameters. Response: { "status": "success", "result": { "measures": [ { "metadata": { "name": "I" }, "value_type": "Real", "uid": "I" }, { "metadata": { "name": "R" }, "value_type": "Real", "uid": "R" }, { "metadata": { "name": "S" }, "value_type": "Real", "uid": "S" }, { "metadata": { "name": "total_population" }, "value_type": "Real", "uid": "total_population" } ], "parameters": [ { "metadata": { "name": "beta" }, "value_type": "Real", "uid": "beta" }, { "metadata": { "name": "gamma" }, "value_type": "Real", "uid": "gamma" }, { "metadata": { "name": "i_initial" }, "value_type": "Real", "uid": "i_initial" }, { "metadata": { "name": "r_initial" }, "value_type": "Real", "uid": "r_initial" }, { "metadata": { "name": "s_initial" }, "value_type": "Real", "uid": "s_initial" }, { "metadata": { "name": "beta" }, "value_type": "Real", "default": 0.4, "uid": "beta" }, { "metadata": { "name": "gamma" }, "value_type": "Real", "default": 0.04, "uid": "gamma" }, { "metadata": { "name": "i_initial" }, "value_type": "Real", "default": 3, "uid": "i_initial" }, { "metadata": { "name": "r_initial" }, "value_type": "Real", "default": 0, "uid": "r_initial" }, { "metadata": { "name": "s_initial" }, "value_type": "Real", "default": 997, "uid": "s_initial" } ] }
}
